import React, { Component } from 'react';
import Header from './components/Header';
import Contents from './components/Contents';
import './App.css';

class App extends Component {
  componentWillMount() {
    document.title = '칸 국제영화제'
  }
  render() {
    return (
      <div className="App">
        <Header></Header>
        <Contents></Contents>
      </div>
    );
  }
}

export default App;
